In the previous chapter, we defined AppContext as a concrete implementation for the context traits HasError, PersonContext, and PersonQuerier. Based on the earlier definition of SimpleGreeter and its Greeter implementation, we can deduce that SimpleGreeter should implement Greeter<AppContext>. But how can we ensure that we implemented AppContext correctly to be used by SimpleGreeter? If we forgot to implement any dependency that is required by SimpleGreeter, such as PersonQuerier, we would get a compile-time error when trying to use SimpleGreeter as Greeter<AppContext>. Worse, if we try to use SimpleGreeter within another generic component, the error messages may become too incomprehensible to find out what went wrong. In test-driven development, it is common practice that we would write tests that check that our code satisfies certain requirements and constraints. Following the same principle, we would want to write tests that check that SimpleGreeter does implements Greeter<AppContext>. But instead of writing dynamic tests that checks for the program behavior at runtime, we can write static tests that checks that the program requirements are satisfied at compile time . Our test would be implemented as an app_greeter function which checks at compile time that SimpleGreeter implements Greeter<AppContext>: # trait NamedPerson {
# fn name(&self) -> &str;
# }
#
# trait HasError {
# type Error;
# }
#
# trait PersonContext {
# type PersonId;
# type Person: NamedPerson;
# }
#
# trait PersonQuerier: PersonContext + HasError {
# fn query_person(&self, person_id: &Self::PersonId)
# -> Result<Self::Person, Self::Error>;
# }
#
# trait Greeter<Context>
# where
# Context: PersonContext + HasError,
# {
# fn greet(&self, context: &Context, person_id: &Context::PersonId)
# -> Result<(), Context::Error>;
# }
#
# struct SimpleGreeter;
#
# impl<Context> Greeter<Context> for SimpleGreeter
# where
# Context: PersonQuerier,
# {
# fn greet(&self, context: &Context, person_id: &Context::PersonId)
# -> Result<(), Context::Error>
# {
# let person = context.query_person(person_id)?;
# println!("Hello, {}", person.name());
# Ok(())
# }
# }
# struct BasicPerson {
# name: String,
# }
#
# impl NamedPerson for BasicPerson {
# fn name(&self) -> &str {
# &self.name
# }
# }
#
# struct AppContext {
# database: Database,
# }
#
# // Database stubs
# struct Database;
# struct DbError;
#
# enum AppError {
# Database(DbError),
# // ...
# }
#
# impl HasError for AppContext {
# type Error = AppError;
# }
#
# impl PersonContext for AppContext {
# type PersonId = String;
# type Person = BasicPerson;
# }
#
# impl PersonQuerier for AppContext {
# fn query_person(&self, person_id: &Self::PersonId)
# -> Result<Self::Person, Self::Error>
# {
# unimplemented!() // database stub
# }
# }
#
fn app_greeter() -> impl Greeter<AppContext> { SimpleGreeter
} Our app_greeter function accepts nothing and returns impl Greeter<AppContext>. This indicates that the function can return a value with an existential type that implements Greeter<AppContext>. Inside the function body, we simply return a SimpleGreeter value. From the surface, it may look like this is effectively the same as the function with signature fn app_greeter() -> SimpleGreeter. But by returning impl Greeter<AppContext>, we force the Rust compiler to check here that SimpleGreeter must implement Greeter<AppContext>. Having app_greeter compiled successfully is sufficient to prove that SimpleGreeter can always be used as a Greeter<AppContext>. Hence, we can say that app_greeter is a proof that SimpleGreeter: Greeter<AppContext>. We call static tests like app_greeter as proofs, as it works similar to writing mathematical proofs as programs in dependent-typed programming . In this style of programming,the type-checking of a program alone is sufficient to prove that a given requirement is always satisfied, without us having to execute the program. This is much more efficient as compared to dynamic checking, which can only check for requirements at runtime and raise errors when the requirements are not satisfied.

