function daytime_greeter(in_greeter) { return function(context, person_id) { const now = context.now() if now.is_daytime() { return in_greeter.greet(context, person_id) } else { throw new ShopeClosedError({ time: now }) } }
} function build_daytime_greeter_class(deps) { return Class { constructor(in_greeter) { this.in_greeter = in_greeter } greet(context, person_id) { const now = deps.HasTime.prototype.now.call(context) if deps.HasTime.Time.prototype.is_daytime.call(now) { return deps.InGreeter.prototype.greet.call( this.in_greeter, context, person_id) } else { throw deps.HasError.Error.from( new ShopeClosedError({ time: now })) } } }
} const DaytimeGreeter = build_daytime_greeter_class({ InGreeter: ..., HasError: { Error: { from: function(err) { ... } }, }, PersonContext: { PersonId: ..., Person: ..., }, HasTime: { Time: { prototype: { is_daytime: function() { ... } } } },
}) function build_daytime_greeter_class(deps) { const { HasTime, HasError, InGreeter, } = deps const { Time } = HasTime const { Error } = HasError return Class { constructor(in_greeter) { this.in_greeter = in_greeter } greet(context, person_id) { const now = HasTime.prototype.now.call(context) if Time.prototype.is_daytime.call(now) { return InGreeter.prototype.greet.call( this.in_greeter, context, person_id) } else { throw Error.from( new ShopeClosedError({ time: now })) } } }
}

