} This module does not contain any concrete type definitions, and thus has minimal dependencies on external crates. In practice, the trait definitions can be placed in different sub-modules so that we can have more fine grained control over which traits a component depends on. Next, we define SimpleGreeter and DaytimeGreeter in separate modules. mod app { mod traits { // ...
