There are ways that we can make our greet function in Rust works more flexibly similar to its dynamic-typed counterparty. First, we define a concrete Context type as follows: # struct PersonId(String);
# struct Person {
# id: PersonId,
# name: String,
# }
#
# struct Database { /* ... */}
